from PySide import QtCore, QtGui
import qdarkstyle
import base64


class Ui_Dialog(QtGui.QDialog):

    option = ""


    def __init__(self):
        super(Ui_Dialog, self).__init__()
        self.setImg()
        self.getOpt()


    def getOpt(self):
        self.setupUi(self)
        self.vcfBtn.clicked.connect(self.vcf)
        self.androidBtn.clicked.connect(self.andr)

        self.closeBtn.clicked.connect(self.closeb)

        self.goBtn.clicked.connect(self.go)

        self.setWindowFlags(QtCore.Qt.FramelessWindowHint)
        self.setStyleSheet(qdarkstyle.load_stylesheet())
        self.show()
        self.closeBtn.setFocus()

    def go(self):
        self.logBox.append("")
        d = QtGui.QMessageBox.information(self, "Please Wait...",
                                          "Connecting and collecting data... \n"
                                          "Please wait as this may take a few minutes...\n"
                                          "The contact list will load as soon as the process completes...")
        if d:
            self.close()

    def vcf(self):
        self.option = "vcf"
        self.close()

    def andr(self):
        self.stack.setCurrentIndex(1)
        self.option = "android"

    def closeb(self):
        self.option += "exit"
        self.close()

